import { CHANGE_PAGE } from '../actions/types'

const initialState = {
    page: 1
}

export default function(state = initialState,action){
    switch(action.type){
        case CHANGE_PAGE:
            return{
                ...state,
                page:action.payload
            }
        default:
            return state
    }
}
